import React from "react";

class PreferredDeliveryTimeForm extends React.Component {
  render() {
    return (
      <div>
        <form>
          <label>
            Choose your preferred delivery time:
            <select>
              <option>Hello World</option>
            </select>
          </label>
        </form>
      </div>
    );
  }
}

export default PreferredDeliveryTimeForm;
